    [],nt"revision_timestamp": "2015-09-27T00:06:06.762198",nt"name": "cnmi-american-samoa-and-guam-small-boat-fishery-trip-expenditure-2009-to-present",nt"isopen":
    false,nt"url": null,nt"notes": "This is a time-series dataset of trip expenditure
    data including actual fishing trip expenses, input usage, and input prices, for
    boat-based reef fish, bottomfish, and pelagic fisheries in CNMI, American Samoa,
    and Guam.  Specifically, the surveys intend to collect information on: gallons of
    fuel used for the fishing trip, price per gallon of fuel, cost of ice used, cost
    of bait & chum used, cost of fishing gear lost, and the engine type of the boat.
     These economic data are collected through an add-on to boat-based creel surveys
    initiated  by local fisheries agencies in CNMI, American Samoa, and Guam to collect
    fisheries dependent data.  The data collection program was implemented in April
    2009 in CNMI, August 2009 in American Samoa, and September 2011 in Guam.",nt"license_title":
